import React from 'react';

const AboutMe = () => {
    return (
        <div className='about-me-page'>
            <h2 className='heading'>Who am I?</h2>
            <p>I am a <a href='https://dictionary.cambridge.org/dictionary/english/polymath' rel='noopener noreferrer' target='_blank'>polymath</a></p>
            <p>I was tired of conventional PDF resumes.</p>
            <p>So 20th century.</p>
            <p>You can find all of my information here.</p>
            <p>Enjoy.</p>
        </div>
    )
}

export default AboutMe;
